import React, { useEffect, useState } from "react";
import { Table, Container, Button } from "react-bootstrap";
import axios from "axios";

function ViewRecords() {
  const [records, setRecords] = useState([]);

  useEffect(() => {
    // Fetch data from API (replace URL with the correct one)
    axios
      .get("http://localhost:8085/intake/get") // Example API endpoint
      .then((response) => {
        setRecords(response.data);
      })
      .catch((error) => {
        console.error("Error fetching records:", error);
      });
  }, []);

  return (
    <Container className="mt-5">
      <h1 className="text-center mb-4">Company Records</h1>

      {records.length > 0 ? (
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Count</th>
              <th>Waste ID</th>
              <th>Farmer Name</th>
              <th>Collected By</th>
              <th>Place</th>
              <th>Collected Date</th>
              <th>Weight (tons)</th>
              <th>Rate per Ton</th>
              <th>Total Price</th>
            </tr>
          </thead>
          <tbody>
            {records.map((record, index) => (
              <tr key={index}>
                <td>{record.id}</td>
                <td>{record.wasteId}</td>
                <td>{record.farmerName}</td>
                <td>{record.collectedBy}</td>
                <td>{record.collectedDate}</td>
                <td>{record.place}</td>
                <td>{record.weight}</td>
                <td>{record.rate}</td>
                <td>{record.totalPrice}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      ) : (
        <p className="text-center">No records found.</p>
      )}
    </Container>
  );
}

export default ViewRecords;
